class LandingPage extends React.component {
  render() {
    return (
      <Fragment>
        <div className="img-container">
          <imgComponent />
        </div>
        <div className="big-second-container">
          <Home />
        </div>
      </Fragment>
    );
  }
}

export default LandingPage;
